,3144,'How many times program staff attempted to contact or locate a patient or his/her treatment supporter after that patient missed a visit.','en',1,'2008-06-11 13:30:11',NULL,NULL),(3910,3071,'Hypertensive heart disease is any of a number of complications of arterial hypertension that affect the heart.','en',1,'2008-06-17 11:38:11',NULL,NULL),(3911,3072,'Valvular heart disease is commonly caused by damage to the heart muscle as a result of rheumatic fever or a congenital abnormality. In older persons, the heart valves can become calcified as part of the aging process, thus become narrowed and stiff, or in some cases, incompetent so that they leak blood back into the atria. Valvular heart problems can be corrected surgically, by direct repair of the valve, replacement of the damaged valve with an artificial valve, or by a nonsurgical technique called balloon valvuloplasty. Patients with valvular heart disease are also at risk for bacterial endocarditis.','en',1,'2008-06-17 11:41:47',NULL,NULL),(3912,3174,'Diagnosis of cardiology-related conditions at the beginning of an encounter ','en',1,'2008-06-17 11:42:21',NULL,NULL),(3913,3175,'Mitral stenosis is a valvular heart disease characterized by the narrowing of the orifice of the mitral valve of the heart.','en',1,'2008-06-17 11:59:53',NULL,NULL),(3914,3176,'aortic regurgitation (AR)is the leaking of the aortic valve of the heart that causes blood to flow in the reverse direction during ventricular diastole, from the aorta into the left ventricle.','en',1,'2008-06-17 12:03:53',NULL,NULL),(3915,3177,'Atrial fibrillation (AF or afib) is a cardiac arrhythmia (abnormal heart rhythm) that involves the two upper chambers (atria) of the heart.','en',1,'2008-06-17 12:58:30',NULL,NULL),(3916,3178,'Diagnosis answer for patient who is post op','en',1,'2008-06-17 13:12:04',NULL,NULL),(3917,3179,'Date of last surgery','en',1,'2008-06-17 13:14:21',NULL,NULL),(3918,3180,'Biological heart valves are made from tissue taken from animals or human cadavers. They are treated with preservatives and sterilized for human implantation.','en',1,'2008-06-17 13:24:26',NULL,NULL),(3919,3181,'A mechanical heart valve is made of man made materials. The advantage of mechanical valves is that they can usually last a lifetime. They do not wear out the way natural or biological valves do.','en',1,'2008-06-17 13:25:48',NULL,NULL),(3920,3182,'ACE Inhibitor. Captopril is used to treat high blood pressure (hypertension), congestive heart failure, kidney problems caused by diabetes, and to improve survival after a heart attack','en',1,'2008-06-17 13:31:41',NULL,NULL),(3921,3183,'Lisinopril is in a group of drugs called ACE inhibitors. Lisinopril is used to treat high blood pressure, congestive heart failure, and to improve survival after a heart attack','en',1,'2008-06-17 13:37:09',NULL,NULL),(3922,3184,'Aldactone is a potassium sparing diuretic that prevents your body from absorbing too much salt and keeps your potassium levels from getting too low.','en',1,'2008-06-17 13:38:25',NULL,NULL),(3923,3185,'Carvedilol is a non selective beta blocker indicated in the treatment of mild to moderate congestive heart failure.','en',1,'2008-06-17 13:39:48',NULL,NULL),(3924,3186,'Atenolol is used alone or in combination with other medications to treat high blood pressure. It also is used to prevent angina (chest pain) and treat heart attacks. Atenolol is in a class of medications called beta blockers.','en',1,'2008-06-17 13:40:59',NULL,NULL),(3925,3187,'Amlodipine (as besylate, mesylate or maleate) is a long-acting calcium channel blocker (dihydropyridine) used as an anti-hypertensive and in the treatment of angina','en',1,'2008-06-17 13:42:32',NULL,NULL),(3926,3188,'Potassium is an essential dietary mineral and electrolyte.','en',1,'2008-06-17 13:48:01',NULL,NULL),(3927,3189,'Testosterone-like steroid ','en',1,'2008-06-17 13:58:30',NULL,NULL),(3928,3190,'Warfarin is used to prevent blood clots from forming or growing larger in